import React from 'react'
import { HeartTwoTone } from '@ant-design/icons';
import 'antd/dist/antd.css';

class ShowFull extends React.Component{
    render(){
        return(
            <>
                <div style={{padding: '5px 0', width : '300px',borderRadius: '15px 15px 0 0',backgroundColor: '#00000025'}}>
                    Chung ta da ben nhau...
                </div>
                <div style={{padding: '2px 0', width : '300px',backgroundColor: '#00000010'}}></div>
                <div style={{height: '100px', width : '300px',borderRadius: '0px 0px 15px 15px',backgroundColor: '#00000025'}}>
                    <HeartTwoTone style={{fontSize:'30px'}} />
                    <HeartTwoTone style={{fontSize:'30px'}} />
                    <HeartTwoTone style={{fontSize:'30px'}} />
                    <HeartTwoTone style={{fontSize:'30px'}} />
                    <HeartTwoTone style={{fontSize:'30px'}} />
                    <HeartTwoTone style={{fontSize:'30px'}} />
                    <HeartTwoTone style={{fontSize:'30px'}} />
                    
                
                </div>
            </>
        )
    }
}

export default ShowFull;
